import {StyleSheet, View, Text, StatusBar, SafeAreaView, Image} from 'react-native'
import * as React from 'react';
import { MaterialIcons } from '@expo/vector-icons';
import {createNativeStackNavigator} from '@react-navigation/native-stack'

let Overview = function(){}
let Challenges = function(){}
let Achievements = function(){}

const sreens = {
  Overview: {
    screen: Progress
  },
  Challenges: {
    screen: Challenges
  },
  Achievements: {
    screen: Achievements
  }
}

const stack = createNativeStackNavigator(screens);


export function Progress() {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.topLabel}>        
            <Image style={styles.logo}source={{uri:'https://reactnative.dev/img/tiny_logo.png'}}/>           
            <Text style={styles.textLabel}>Progress</Text>
            <MaterialIcons style={styles.account} name="account-circle" size={50} color="black" />
        </View>
        <View>
          <Text>df</Text>
        </View>
      </SafeAreaView>
    );
  }

const styles = StyleSheet.create({
    container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center'
    },
    topLabel: {
        backgroundColor: '#202c40',
        flexDirection: 'row',
        height: 60
    },
    logo:{
        width:50,
        height:50
    },
    textLabel: {
        fontSize: 40
    },
    account: {
        
    }
});
